import logo from './logo.svg';
import './App.css';


import {
  DataTable,
  Table,
  TableHead,
  TableRow,
  TableHeader,
  TableBody,
  TableCell,
} from 'carbon-components-react';

const rows = [
  {
    id: 'a',
    name: 'Jason Nolen',
    username:'json',
    status: 'Disabled',
    superuser: 'False',
    staff: 'True',
    active: 'False'
  },
  {
    id: 'b',
    name: 'John Smith',
    username: 'jsmith',
    status: 'Disabled',
    superuser: 'True',
    staff: 'True',
    active: 'True'
  },
  {
    id: 'c',
    name: 'Scott Adams',
    username: 'sadams',
    status: 'Disabled',
    superuser: 'True',
    staff: 'False',
    active: 'True'
  },
  {
    id: 'd',
    name: 'Megan Mcloud',
    username: 'mmcloud',
    status: 'Disabled',
    superuser: 'True',
    staff: 'True',
    active: 'False'
  },
  {
    id: 'e',
    name: 'Bill Evans',
    username: 'bevans',
    status: 'Disabled',
    superuser: 'True',
    staff: 'True',
    active: 'False'
  },
  {
    id: 'f',
    name: 'Todd Baker',
    username: 'tbaker',
    status: 'Disabled',
    superuser: 'True',
    staff: 'True',
    active: 'False'
  }

];

const headers = [
  {
    key: 'name',
    header: 'Name',
  },
  {
    key: 'username',
    header: 'Username',
  },
  {
    key: 'superuser',
    header: 'Superuser',
  },
  {
    key: 'staff',
    header: 'Staff',
  },
  {
    key: 'active',
    header: 'Active',
  },
];
function ticker_icon(value){
  if (value=='True'){
    return 'Okay'
  }
  else{
    return value
  }
}

function App() {
  return (
<DataTable rows={rows} headers={headers}>
  {({ rows, headers, getTableProps, getHeaderProps, getRowProps }) => (
    <Table {...getTableProps()}>
      <TableHead>
        <TableRow>
          {headers.map((header) => (
            <TableHeader {...getHeaderProps({ header,isSortable: true,showToolbar: true })}>
              {header.header}
            </TableHeader>
          ))}
        </TableRow>
      </TableHead>
      <TableBody>
        {rows.map((row) => (
          <TableRow {...getRowProps({ row })}>
            {row.cells.map((cell) => (

              <TableCell key={cell.id}>{ticker_icon(cell.value)}</TableCell>
            ))}
          </TableRow>
        ))}
      </TableBody>
    </Table>
  )}
</DataTable>
  );
}

export default App;
